import React, { useEffect, useState } from 'react';
import axios from 'axios';
import qs from 'qs';

export default function Admin(props) {
    function submit(e) {
        e.preventDefault(e);
        const form = e.target;
        const inputs = {
            name: form.elements['name'],
            address: form.elements['address'],
            latitude: form.elements['latitude'],
            longitude: form.elements['longitude'],
        };
        console.log("submit " + Object.values(form));
        const url = "http://localhost:3000/api/addRestaurant";
        const options = {
            method: 'POST',
            headers: {
                'content-type':
                    'application/x-www-form-urlencoded'
            },
            data: qs.stringify(inputs),
            url,
        };
        axios(options);
        console.log(qs.stringify(inputs));
    }
    return (
        <div>
            <h2>Add Restaurant</h2>
            <form onSubmit={(e) => submit(e)}>
                <div className="row">
                    <div className="col-sm-2">
                        <label>Name: </label>
                        <br />
                        <input name="name" type="text" />
                    </div>
                    <div className="col-sm-4">
                        <label>Address: </label>
                        <br />
                        <input name="address" type="text" />
                    </div>
                    <div className="col-sm-2">
                        <label>Latitude: </label>
                        <br />
                        <input name="latitude" type="text" />
                    </div>
                    <div className="col-sm-2">
                        <label>Longitude: </label>
                        <br />
                        <input name="longitude" type="text" />
                    </div>
                    <div className="col-sm-2">
                        <input className="btn btn-primary" type="submit" />
                    </div>
                </div>
            </form>
        </div>
    );
}
